import React from "react";
import "./AboutMe.css";

function AboutMe() {
  return (
    <div className="aboutMe">
      <div className="container">
        <div className="aboutMePicture">
          <img
            src="./static/modern-laptop.jpg"
            className="aboutMePicture"
            alt="profile"
          />
        </div>
        <div className="aboutMeText"></div>
      </div>
    </div>
  );
}

export default AboutMe;
